const Botones = () => {

    const Estilos = {
        Main: 'flex justify-evenly content-end h-1/5 my-12',
        Button: 'relative w-full h-full overflow-hidden bg-[#1b6102] rounded-lg border-8 border-[#2da202] border-double mx-2 my-1 font-[system-ui] font-semibold text-5xl text-white',
    }

    return ( 
        <div className={Estilos.Main}>
            <button className=
            {Estilos.Button}
            >List View</button>
            <button className={Estilos.Button}>Details</button>
            <button className={Estilos.Button}>Search</button>
            <button className={Estilos.Button}>Close</button>
        </div>
    );
}

export default Botones;
